import "./About.css";
import React, { useState } from "react";
import Aboutus from "./images/About.jpg";

function About() {
    return (
        <div className="about-heading">
            <img src={Aboutus} width={100} height={100} alt="About us" />
        </div>
    );
}

export default About;
